import React from "react";
import { isAutheticated } from "../auth/helper";
import Base from "../core/Base";
Link
const PurchaseList = () => {
  const { user, token } = isAutheticated();
  return (
    <Base
      title="User Purchase List"
      description="Here is the list of items purchased"
    >
        <div className="card">
        <h4 className="card-header bg-dark text-white">User Navigation</h4>
        <ul className="list-group">
          <li className="list-group-item">
            <Link to="/user/profile" className="nav-link text-success">
              Profile
            </Link>
          </li>
          <li className="list-group-item">
            <Link to="/user/manageProfile" className="nav-link text-success">
              Manage Profile
            </Link>
          </li>
          <li className="list-group-item">
            <Link to="/user/purchaselist" className="nav-link text-success">
              Purchase List
            </Link>
          </li>
        </ul>
      </div>
    </Base>
  );
};

export default PurchaseList;
